import React from "react";
import "./Contact.css";
import "../App.css";
import Footer from "./Footer";

function Contact() {
  return (
    <>
      <div className="container">
        <h1 className="page-title">Contact</h1>
        <hr></hr>
        <ul>
          <li>Email: crystalsmagickcorner@gmail.com</li>
          <li>Youtube: https://www.youtube.com/@crystalsmagickcorner</li>
          <li></li>
        </ul>
      </div>
      <Footer />
    </>
  );
}

export default Contact;
